class Node:    def __init__ (self,data):        self.data = data        self.prev = None            def get_data(self):        return self.data        def set_prev(self, prev):        self.prev = prev        def get_prev(self):        return self.prev    class Queue:    def __init__ (self):        self.front = None        self.rear = None        self.size = 0            def enqueue(self,data):        new_node = Node(data)        self.size += 1        if self.front == None:            self.front = new_node        else:            self.rear.set_prev(new_node)        self.rear = new_node    def dequeue(self):        self.size -= 1        front_node = self.front        if front_node == None:            print("보유중인 데이터가 없습니다.")        elif self.size == 1:            self.rear = None            front_node = None        else:            front_node = front_node.get_prev()            front_node.set_prev(front_node.get_prev())            def print_queue(self):        node = self.front        print(">> current queue")        while self.front != None:            print(node.get_data())            node = node.get_prev()        print(">>>>>>>>>>>>>>>>")                  queue = Queue()queue.enqueue("Apple")queue.enqueue("Kiwi")queue.enqueue("Banana")queue.print_queue()node = queue.dequeue()print("Dequeue:" + node.get_data())node = queue.dequeue()print("Dequeue:" + node.get_data())queue.enqueue("Melon")queue.print_queue()            